import React from "react";
import Navbar from "../components/Navbar";
import './Contact.css';


function WW() {
  return (
    <div>
      <Navbar />
      <div className="content-container">
        <h1>Welcome to the Movie Collections Page</h1>
        <p>Select a movie from the dropdown to view its worldwide collections.</p>
        <p>Currently, the detailed collections are not displayed in table format.</p>
      </div>
    </div>
  );
}

export default WW;
